function loadGameData(){var str=Utils.getCookie(getGameDataId());var data=str?JSON.parse(str):{};if(!data.games)data.games=0;if(!data.best)data.best=0;if(!data.meters)data.meters=0;soundOn=data.sound!==undefined?data.sound:true;musicOn=data.music!==undefined?data.music:true;return data}function saveGameData(data){Utils.setCookie(getGameDataId(),JSON.stringify(data))}
function showMoreGames(){if(!ExternalAPI.exec("customMoreGames")&&!ExternalAPI.exec("showMoreGames"))window.open(ExternalAPI.getMoreGamesURL(),"_blank")}function addJSFile(fileSrc){var script=document.createElement("script");script.src=fileSrc;document.getElementsByTagName("head")[0].appendChild(script)}
function setBitmapText(parent,font,textValue,x,y,properties){var name=font+"_"+I18.currentLocale;var json_obj=window[name];var text=new BitmapText(library.getBitmap("fonts/"+I18.currentLocale+"/"+font),json_obj);text.setPosition(x,y);text.parent=parent;applyProperties(text,properties);text.write(textValue);return text}
function applyProperties(obj,properties){var value;for(var k in properties){value=properties[k];if(k=="zI"||k=="zIndex")obj.setZIndex(value);else if(k=="static"||k=="s")obj.setStatic(value);else if(k=="w")obj.width=value;else if(k=="h")obj.height=value;else if(k=="fC")obj.fillColor=value;else if(k=="o")obj.opacity=value;else if(k=="r")obj.rotation=value;else if(k=="a")obj.align=value;else if(k=="vA")obj.valign=value;else obj[k]=value}}if(window.ExternalAPI)window.ExternalAPI.getPreloaderURL=function(){return""};
if(window.ExternalAPI)window.ExternalAPI.getMoreGamesButtonDisable=function(){return true};